      <h1 id="SFtitle"> Sample Flowers</h1>
        <h1 class="blahinfo">Customer Request</h1>
        <div>
        <div class="blahinfo"><h2></h2>
        <form>
  <label>
    Name:
    <input type="text" name="name" />
    Last Name:
    <input type="text" name="name"/>
  </label>
     Customer Request:<div>

   <textarea name= "postContent"/>
 </div> 
 <div>
   
